module.exports = {"app":"<% if (locale.current() === 'he-IL') { %>\r\n  <link rel='stylesheet' href='./style-rtl.css'>\r\n<% } %>\r\n\r\n<div id='loader' class='loader'></div>\r\n<div id='drawer' class='sidebar' <% if (locale.current() === 'he-IL') { %>dir='rtl'<% } %>></div>\r\n<nav id='navigation'></nav>\r\n<div id='main' <% if (locale.current() === 'he-IL') { %>dir='rtl'<% } %>></div>\r\n\r\n<div class='prose-menu dropdown-menu' <% if (locale.current() === 'he-IL') { %>dir='rtl'<% } %>>\r\n  <div class='inner clearfix'>\r\n    <a href='#' class='icon branding dropdown-hover' data-link=true>Prose</a>\r\n    <ul class='dropdown clearfix'>\r\n      <li><a href='#'>Project-Pages</a></li>\r\n      <li><a class='about' href='#about'><%= t('navigation.about') %></a></li>\r\n      <li><a class='help' href='https://github.com/prose/prose'><%= t('navigation.develop') %></a></li>\r\n      <li class='divider authenticated'></li>\r\n      <li class='authenticated'>\r\n        <a href='#' class='logout'><%= t('navigation.logout') %></a>\r\n      </li>\r\n    </ul>\r\n  </div>\r\n</div>\r\n","breadcrumb":"<span class='slash'>/</span>\r\n<a class='path' href='#<%= trail %>/<%= url %>'><%= name %></a>\r\n","chooselanguage":"<h1><%= t('chooselanguage.title') %></h1>\r\n<ul class='fat-list round'>\r\n  <% _(chooseLanguage.languages).each(function(l) { %>\r\n    <li>\r\n    <a href='#' data-code='<%= l.code %>' class='language<% if (l.code === chooseLanguage.active) { %> active<% } %>'>\r\n        <% if (l.code === chooseLanguage.active) { %><span class='ico checkmark fr'></span><% } %>\r\n        <%= l.name %>\r\n        <small>(<%= l.code %>)</small>\r\n      </a>\r\n    </li>\r\n  <% }); %>\r\n</ul>\r\n<p><%= t('chooselanguage.description') %></p>\r\n","dialogs":{"help":"<%\r\n  function formattedClass(str) {\r\n    return str.toLowerCase().replace(/\\s/g, '-').replace('&amp;', '');\r\n  };\r\n%>\r\n\r\n<div class='col col25'>\r\n  <ul class='main-menu'>\r\n    <% _(help).each(function(mainMenu, i) { %>\r\n      <li><a href='#' class='<% if (i === 0) { %>active <% } %>' data-id='<%= formattedClass(mainMenu.menuName) %>'><%= mainMenu.menuName %></a></li>\r\n    <% }); %>\r\n  </ul>\r\n</div>\r\n\r\n<div class='col col25'>\r\n  <% _(help).each(function(mainMenu, index) { %>\r\n  <ul class='sub-menu <%= formattedClass(mainMenu.menuName) %> <% if (index === 0) { %>active<% } %>' data-id='<%= formattedClass(mainMenu.menuName) %>'>\r\n      <% _(mainMenu.content).each(function(subMenu, i) { %>\r\n        <li><a href='#' data-id='<%= formattedClass(subMenu.menuName) %>' class='<% if (index === 0 && i === 0) { %> active<% } %>'><%= subMenu.menuName %></a></li>\r\n      <% }); %>\r\n    </ul>\r\n  <% }); %>\r\n</div>\r\n\r\n<div class='col col-last prose small'>\r\n  <% _(help).each(function(mainMenu, index) { %>\r\n    <% _(mainMenu.content).each(function(d, i) { %>\r\n    <div class='help-content inner help-<%= formattedClass(d.menuName) %><% if (index === 0 && i === 0) { %> active<% } %>'>\r\n      <%= d.data %>\r\n    </div>\r\n    <% }); %>\r\n  <% }); %>\r\n</div>\r\n","link":"<div class='inner'>\r\n  <label><%= t('dialogs.link.title') %></label>\r\n  <input type='text' name='href' placeholder=\"<%= t('dialogs.link.hrefPlaceholder') %>\" />\r\n  <input type='text' name='text' placeholder=\"<%= t('dialogs.link.textPlaceholder') %>\" />\r\n  <input type='text' name='title' placeholder=\"<%= t('dialogs.link.titlePlaceholder') %>\" />\r\n\r\n  <% if (relativeLinks) { %>\r\n    <div class='collapsible'>\r\n      <select data-placeholder=\"<%= t('dialogs.link.insertPlaceholder') %>\" class='chzn-select'>\r\n        <option value></option>\r\n        <% _(relativeLinks).each(function(link) { %>\r\n        <option value='<%= link.href %>,<%= link.text %>'><%= link.text %></option>\r\n        <% }); %>\r\n      </select>\r\n    </div>\r\n  <% } %>\r\n\r\n  <a href='#' class='button round insert' data-type='link'><%= t('dialogs.link.insert') %></a>\r\n</div>\r\n","media":"<div class='inner clearfix'>\r\n\r\n  <div <% if (assetsDirectory) { %>class='col fl'<% } %>>\r\n    <label><%= t('dialogs.media.title') %></label>\r\n\r\n    <% if (writable) { %>\r\n      <div class='contain clearfix'>\r\n        <span class='ico picture-add fl'></span>\r\n        <%= description %>\r\n      </div>\r\n    <% } %>\r\n\r\n    <input type='text' name='url' placeholder=\"<%= t('dialogs.media.hrefPlaceholder')%>\" />\r\n    <input type='text' name='alt' placeholder=\"<%= t('dialogs.media.altPlaceholder')%>\" />\r\n    <a href='#' class='button round insert' data-type='media'><%= t('dialogs.link.insert') %></a>\r\n      <% if (!assetsDirectory) { %>\r\n        <small class='caption deemphasize'><%= t('dialogs.media.help') %></small>\r\n      <% } %>\r\n  </div>\r\n\r\n  <% if (assetsDirectory) { %>\r\n    <div class='col col-last fl media-listing'>\r\n      <label><%= t('dialogs.media.choose') %></label>\r\n      <ul id='media'></ul>\r\n      <small class='caption deemphasize'><%= t('dialogs.media.helpMedia') %></small>\r\n    </div>\r\n  <% } %>\r\n</div>\r\n","mediadirectory":"<% if (type === 'tree') { %>\r\n  <li class='directory'>\r\n    <span class='mask'></span>\r\n    <a class='clearfix item' href='<%= path %>'>\r\n      <span class='ico fl small inline folder'></span>\r\n      <%= name %>\r\n    </a>\r\n  </li>\r\n<% } else { %>\r\n  <li class='asset'>\r\n    <span class='mask'></span>\r\n    <a class='clearfix item' href='<%= path %>' title='<%= path %>'>\r\n      <% if (isMedia) { %>\r\n        <span class='ico fl small inline media'></span>\r\n      <% } else { %>\r\n        <span class='ico fl small inline document'></span>\r\n      <% } %>\r\n      <%= name %>\r\n    </a>\r\n  </li>\r\n<% } %>\r\n"},"drawer":"<div id='orgs'></div>\r\n<div id='branches'></div>\r\n<div id='history'></div>\r\n<div id='drafts'></div>\r\n<div id='save'></div>\r\n<div id='settings'></div>\r\n","file":"<header id='heading' class='heading limiter clearfix'></header>\r\n<div id='modal'></div>\r\n\r\n<div id='post' class='post limiter'>\r\n  <div class='editor views<% if (file.markdown) { %> markdown<% } %>'>\r\n    <div id='diff' class='view prose diff'>\r\n      <h2><%= t('main.file.metaTitle') %><br />\r\n        <span class='deemphasize small'><%= t('main.file.metaDescription') %></span>\r\n      </h2>\r\n      <div class='diff-content inner'></div>\r\n    </div>\r\n    <div id='meta' class='view round meta'></div>\r\n    <div id='edit' class='view active edit'>\r\n      <div class='topbar-wrapper'>\r\n        <div class='topbar'>\r\n          <div id='toolbar' class='toolbar round'></div>   <!-- MATIN -->\r\n        </div>\r\n      </div>\r\n      <div id='drop' class='drop-mask'></div>\r\n      <textarea id='code' class='code round inner'></textarea>\r\n    </div>\r\n    <div id='preview' class='view preview prose'></div>\r\n  </div>\r\n</div>\r\n","files":"<% if (data.path && data.path !== data.rooturl) { %>\r\n  <div class='breadcrumb'>\r\n    <a class='branch' href='#<%= data.url %>'>..</a>\r\n    <% _.each(data.parts, function(part) { %>\r\n      <% if (part.name !== data.rooturl) { %>\r\n        <span class='slash'>/</span>\r\n        <a class='path' href='#<%= [data.url, part.url].join(\"/\") %>'><%= part.name %></a>\r\n      <% } %>\r\n    <% }); %>\r\n  </div>\r\n<% } %>\r\n\r\n<ul class='listing'></ul>\r\n","header":"<% if (data.alterable) { %>\r\n  <div class='round avatar'>\r\n    <%= data.avatar %>\r\n  </div>\r\n  <div class='fl details'>\r\n    <h4 class='parent-trail'><a href='#<%= data.user %>'><%= data.user %></a> / <a href='#<%= data.user %>/<%= data.repo.name %>'><%= data.repo.name %></a><% if (data.isPrivate) { %><span class='ico small inline private' title='Private Project'></span><% } %></h4>\r\n    <!-- if (isNew() && !translate) placeholder, not value -->\r\n    <input type='text' class='headerinput' data-mode='<%= data.mode %>' <% print((data.placeholder ? 'placeholder=' : 'value=') + '\"' + data.input + '\"') %>>\r\n    <div class='mask'></div>\r\n  </div>\r\n<% } else { %>\r\n  <div class='avatar round'><%= data.avatar %></div>\r\n  <div class='fl details'>\r\n    <h4><a class='user' href='#<%= data.user %>'><%= data.user %></a></h4>\r\n    <h2><a class='repo' href='#<%= data.path %>'><%= data.title %></a></h2>\r\n  </div>\r\n<% } %>\r\n","li":{"file":"<% if (file.binary) { %>\r\n  <div class='listing-icon icon round <%- file.extension %> <% if (file.media) { %>media<% } %>'></div>\r\n<% } else { %>\r\n  <a href='#<%= file.repo.owner.login %>/<%= file.repo.name %>/edit/<%- file.branch %>/<%- file.path %>' class='listing-icon'>\r\n    <span class='icon round <%- file.extension %> <% if (file.markdown) { %> md<% } %> <% if (file.media) { %> media<% } %>'></span>\r\n  </a>\r\n<% } %>\r\n\r\n<div class='details'>\r\n  <div class='actions fr clearfix'>\r\n    <% if (!file.binary) { %>\r\n      <a class='clearfix'\r\n        title=\"<%= t('main.repo.edit') %>\"\r\n        href='#<%= file.repo.owner.login %>/<%= file.repo.name %>/edit/<%- file.branch %>/<%- file.path %>'>\r\n        <%= t('main.repo.edit') %>\r\n      </a>\r\n    <% } %>\r\n    <% if (file.writable) { %>\r\n      <a\r\n        class='delete'\r\n        title=\"<%= t('main.repo.delete') %>\"\r\n        href='#'>\r\n        <span class='ico rubbish small'></span>\r\n      </a>\r\n    <% } %>\r\n  </div>\r\n  <% if (file.binary) { %>\r\n    <h3 class='title' title='<%- file.name %>'><%- file.name %></h3>\r\n  <% } else { %>\r\n    <h3 class='title' title='<%- file.name %>'><a class='clearfix'href='#<%= file.repo.owner.login %>/<%= file.repo.name %>/edit/<%- file.branch %>/<%- file.path %>'><%- file.name %></a></h3>\r\n  <% } %>\r\n  <span class='deemphasize'><%- file.jailpath %></span>\r\n</div>\r\n","folder":"<a href='#<%= folder.repo.owner.login %>/<%= folder.repo.name %>/tree/<%= folder.branch %>/<%= folder.path %>' class='listing-icon'>\r\n  <span class='icon round folder'></span>\r\n</a>\r\n\r\n<span class='details'>\r\n  <h3 class='title' title='<%= folder.name %>'>\r\n    <a href='#<%= folder.repo.owner.login %>/<%= folder.repo.name %>/tree/<%= folder.branch %>/<%= folder.path %>'>\r\n      <%- folder.name %>\r\n    </a>\r\n  </h3>\r\n  <span class='deemphasize'><%- folder.jailpath %></span>\r\n</span>\r\n","repo":"<!--MATIN, Adjusted Repo Elements to Look Like MDL Cards-->   \r\n\r\n<% if (repo.owner.login == repo.login || repo.name == \"project-pages\") { %>\r\n\r\n<div class=\"demo-card-event mdl-cell mdl-card mdl-shadow--2dp\" style=\" width: 240px; height: 150px; background: rgba(249, 0, 0, 0.81); min-height: 140px\">\r\n  \r\n<div class=\"mdl-card__title mdl-card--expand\"></div>\r\n\r\n<div class=\"mdl-card__actions\" style=\" height: 92px; padding: 16px; background: rgba(0, 0, 0, 0.4); display: flex; box-sizing:border-box; align-items: center;\">\r\n\t<span class=\"demo-card-image__filename\" style=\" color: #fff; font-size: 18px; font-weight: 500;\"><%- repo.name %></span>\r\n</div>\r\n\r\n<div class=\"mdl-card__actions\" style=\" height: 52px; padding: 16px; background: rgba(0, 0, 0, 0.4); display: flex;box-sizing:border-box; align-items: center;\">\r\n\t\r\n\t<a class=\"mdl-button mdl-button--colored mdl-js-button mdl-js-ripple-effect\" style =\"  color: #fff; height: initial; min-width: 0px; padding: 0px; font-size: 18px; \" href='#<%- repo.owner.login %>/<%- repo.name %>'>\r\n\t\tEdit Content\r\n\t</a>\r\n\t\r\n\t<div class=\"mdl-layout-spacer\"></div>\r\n\t\r\n\t<a class=\"mdl-button mdl-button--colored mdl-js-button mdl-js-ripple-effect\" style =\"  color: #fff; height: initial; min-width: 0px; padding: 0px; font-size: 18px; \" href='http://<%- repo.owner.login %>.github.io/<%- repo.name %>/'>\r\n\t\t<i class=\"material-icons md-24\">public</i>\r\n\t</a>\r\n\r\n</div>\r\n\r\n</div>\r\n\r\n<% } else { %>\r\n\r\n<div class=\"demo-card-event mdl-cell mdl-card mdl-shadow--2dp\" style=\" width: 240px; height: 150px; background: rgba(0, 0, 249, 0.81); min-height: 140px\">\r\n  \r\n<div class=\"mdl-card__title mdl-card--expand\"></div>\r\n\r\n<div class=\"mdl-card__actions\" style=\" height: 92px; padding: 16px; background: rgba(0, 0, 0, 0.4 ); display: flex; box-sizing:border-box; align-items: center;\">\r\n\t<span class=\"demo-card-image__filename\" style=\" color: #fff; font-size: 18px; font-weight: 500;\"><%- repo.name %></span>\r\n</div>\r\n\r\n<div class=\"mdl-card__actions\" style=\" height: 52px; padding: 16px; background: rgba(0, 0, 0, 0.4); display: flex;box-sizing:border-box; align-items: center;\">\r\n\t\r\n\t<a class=\"mdl-button mdl-button--colored mdl-js-button mdl-js-ripple-effect\" style =\"  color: #fff; height: initial; min-width: 0px; padding: 0px; font-size: 18px; \" href='#<%- repo.owner.login %>/<%- repo.name %>'>\r\n\t\tEdit Content\r\n\t</a>\r\n\t\r\n\t<div class=\"mdl-layout-spacer\"></div>\r\n\t\r\n\t<a class=\"mdl-button mdl-button--colored mdl-js-button mdl-js-ripple-effect\" style =\"  color: #fff; height: initial; min-width: 0px; padding: 0px; font-size: 18px; \" href='http://<%- repo.owner.login %>.github.io/<%- repo.name %>/'>\r\n\t\t<i class=\"material-icons md-24\">public</i>\r\n\t</a>\r\n\r\n</div>\r\n\r\n</div>\r\n\r\n<% } %>"},"loading":"<div class='loading round clearfix'>\r\n  <div class='loading-icon'></div>\r\n  <span class=\"message\"></span>\r\n</div>\r\n","meta":{"button":"<div class='form-item'>\r\n  <label for='<%= meta.name %>'><%= meta.label %></label>\r\n  <% if (meta.help) { %><small class='deemphasize'><%= meta.help %></small><% } %>\r\n  <fieldset>\r\n    <button class='metafield round <%= meta.name %>' type='button' name='<%= meta.name %>' value='<%= meta.value %>' data-on='<%= meta.on %>' data-off='<%= meta.off %>'><%= meta.on %></button>\r\n  </fieldset>\r\n</div>\r\n","checkbox":"<div class='form-item'>\r\n  <fieldset>\r\n    <input class='metafield' type='checkbox' name='<%= meta.name %>' value='<%= meta.value %>'<% print(meta.checked ? 'checked' : '') %> />\r\n    <label class='aside' for='<%= meta.name %>'><%= meta.label %></label>\r\n  </fieldset>\r\n  <% if (meta.help) { %><small class='deemphasize'><%= meta.help %></small><% } %>\r\n</div>\r\n","multiselect":"<div class='form-item'>\r\n  <label for='<%= meta.name %>'><%= meta.label %></label>\r\n  <% if (meta.help) { %><small class='deemphasize'><%= meta.help %></small><% } %>\r\n\r\n  <fieldset>\r\n    <select id='<%= meta.name %>' name='<%= meta.name %>' data-placeholder='<%= meta.placeholder %>' multiple class='metafield chzn-select'>\r\n      <% _(meta.options).each(function(o) { %>\r\n        <% if (!o.lang || o.lang === meta.lang) { %>\r\n          <% if (o.name) { %>\r\n           <option value='<%= o.value %>'><%= o.name %></option>\r\n          <% } else if (o.value) { %>\r\n           <option value='<%= o.value %>'><%= o.value %></option>\r\n          <% } else { %>\r\n           <option value='<%= o %>'><%= o %></option>\r\n          <% } %>\r\n        <% } %>\r\n      <% }); %>\r\n    </select>\r\n  </fieldset>\r\n\r\n  <% if (meta.alterable) { %>\r\n    <div class='create'>\r\n      <input type='text' class='inline' data-select='<%= meta.name %>' />\r\n      <a href='#' class='round create-select inline button' data-select='<%= meta.name %>' title=\"<%= t('main.file.createMeta') %>\"><%= t('main.file.createMeta') %></a>\r\n    </div>\r\n  <% } %>\r\n</div>\r\n","raw":"<div class='form-item'>\r\n  <label for='raw'><%= t('main.file.rawMeta') %></label>\r\n  <% if (meta.help) { %><small><%= meta.help %></small><% } %>\r\n  <fieldset>\r\n    <div name='raw' id='raw' class='metafield inner'></div>\r\n  </fieldset>\r\n</div>\r\n","select":"<div class='form-item'>\r\n  <label for='<%= meta.name %>'><%= meta.label %></label>\r\n  <% if (meta.help) { %><small class='deemphasize'><%= meta.help %></small><% } %>\r\n\r\n  <fieldset>\r\n    <select name='<%= meta.name %>' data-placeholder='<%= meta.placeholder %>' class='metafield chzn-select'>\r\n      <% _(meta.options).each(function(o) { %>\r\n        <% if (!o.lang || o.lang === meta.lang) { %>\r\n          <% if (o.name) { %>\r\n           <option value='<%= o.value %>'><%= o.name %></option>\r\n          <% } else if (o.value) { %>\r\n           <option value='<%= o.value %>'><%= o.value %></option>\r\n          <% } else { %>\r\n           <option value='<%= o %>'><%= o %></option>\r\n          <% } %>\r\n        <% } %>\r\n      <% }); %>\r\n    </select>\r\n  </fieldset>\r\n</div>\r\n","text":"<div class='form-item'>\r\n  <label for='<%= meta.name %>'><%= meta.label %></label>\r\n  <% if (meta.help) { %><small class='deemphasize'><%= meta.help %></small><% } %>\r\n  <fieldset>\r\n    <input class='metafield' type='text' name='<%= meta.name %>' value='<%= meta.value %>' data-type='<%= meta.type %>' placeholder='<%= meta.placeholder %>' />\r\n  </fieldset>\r\n</div>\r\n","textarea":"<div class='form-item yaml-block'>\r\n  <label for='<%= meta.name %>'><%= meta.label %></label>\r\n  <% if (meta.help) { %><small class='deemphasize'><%= meta.help %></small><% } %>\r\n  <fieldset>\r\n    <textarea class='metafield' id='<%= meta.id %>' type='text' name='<%= meta.name %>' data-type='<%= meta.type %>' placeholder='<%= meta.placeholder %>'><%= meta.value %></textarea>\r\n  </fieldset>\r\n</div>\r\n"},"metadata":"<div class='form'>\r\n<div class='options clearfix'>\r\n</div>\r\n</div>\r\n<a href='#' class='button round finish'><%= t('main.file.back') %></a>","modal":"<div class='modal-content round'>\r\n  <div class='modal-heading inner'>\r\n    <%= t('modal.errorHeading') %>\r\n  </div>\r\n  <div class='prose inner'>\r\n    <p><%= modal.message %></p>\r\n  </div>\r\n  <div class='modal-footer inner'>\r\n    <a href='#' class='button round got-it'><%= t('modal.confirm') %></a>\r\n  </div>\r\n</div>\r\n","nav":"<ul class='mobile nav clearfix'>\r\n  <li>\r\n    <a href='#' class='toggle ico menu round'></a>\r\n  </li>\r\n</ul>\r\n\r\n<ul class='file nav clearfix'>\r\n  <li>\r\n    <a href='#' title=\"<%= t('navigation.edit') %>\" class='ico round pencil edit' data-state='edit'>\r\n      <span class='popup round arrow-right'><%= t('navigation.edit') %></span>\r\n    </a>\r\n  </li>\r\n\r\n  <li>\r\n    <a href='#' title=\"<%= t('navigation.preview') %>\" class='ico round eye blob preview' data-state='blob'>\r\n      <span class='popup round arrow-right'><%= t('navigation.preview') %></span>\r\n    </a>\r\n  </li>\r\n\r\n  <li>\r\n    <a href='#' title=\"<%= t('navigation.meta') %>\" class='ico round metadata meta' data-state='meta'>\r\n      <span class='popup round arrow-right'><%= t('navigation.meta') %></span>\r\n    </a>\r\n  </li>\r\n\r\n  <li>\r\n    <a href='#' title=\"<%= t('navigation.settings') %>\" class='ico round sprocket settings' data-state='settings' data-drawer=true>\r\n      <span class='popup round arrow-right'><%= t('navigation.settings') %></span>\r\n    </a>\r\n  </li>\r\n\r\n  <li>\r\n    <a href='#' title=\"<%= t('navigation.save') %>\" class='ico round save' data-state='save'>\r\n      <div class='status'></div>\r\n      <span class='popup round arrow-right'>\r\n        <%= t('navigation.save') %>\r\n      </span>\r\n    </a>\r\n  </li>\r\n</ul>\r\n\r\n<ul class='auth nav clearfix'>\r\n  <li>\r\n    <a class='ico round switch login' href='<%= data.login %>' title=\"<%= t('login') %>\">\r\n      <span class='popup round arrow-right'><%= t('login') %></span>\r\n    </a>\r\n  </li>\r\n</ul>\r\n","notification":"<div class='notify'>\r\n  <h2 class='icon landing error'>Prose</h2>\r\n  <div class='inner'>\r\n    <p><%= data.message %></p>\r\n    <p class='error'><%= data.error %></p>\r\n\r\n    <% _(data.options).each(function(options) { %>\r\n    <div>\r\n      <a class='button round <% if(options.className) { %><%= options.className %><% } %>' href='<%= options.link %>'><%= options.title %></a>\r\n    </div>\r\n    <% }); %>\r\n  </div>\r\n</div>\r\n","profile":"<!-- MATIN Customized -->\r\n<header id='heading' class='heading limiter clearfix'></header>\r\n\r\n  <!-- Material Design Lite css Library -->\r\n <link rel=\"stylesheet\" href=\"https://storage.googleapis.com/code.getmdl.io/1.0.6/material.blue_grey-light_blue.min.css\" />\r\n  \r\n  <!-- Material Design Fonts -->\r\n<script src=\"https://storage.googleapis.com/code.getmdl.io/1.0.6/material.min.js\"></script>\r\n<link rel=\"stylesheet\" href=\"https://fonts.googleapis.com/icon?family=Material+Icons\">\r\n\r\n<link rel='stylesheet' href='./style.css'>\r\n\r\n<!-- Material Design Formatting -->\r\n\r\n<style>\r\n.newrepo {\r\nfloat:right;\r\nposition: relative;\r\nright: 15%;\r\nwidth: 24%;\r\n}\r\n\r\n\r\n@media (max-width: 1280px) {\r\n.newrepo {\r\ndisplay: none;\r\n}\r\n}\r\n</style>\r\n\r\n<div id='content' class='application content limiter'>\r\n\t<div id=\"newrepo\" class=\"newrepo\">\r\n\t<button class=\"button\" style=\"font-size:14px\" onclick=\"window.open('https://github.com/projectpages/project-pages/fork','_blank');\">\r\n\t  New Project-Pages\r\n\t</button>\r\n\t</div>\r\n  <div class='topbar'>\r\n    <div id='search' class='content-search round'></div>\t\r\n  </div>\r\n  <div id='repos' class='mdl-grid'></div>\r\n</div>","repo":"<header id='heading' class='heading limiter clearfix'></header>\r\n\r\n<div id='content' class='application content limiter'>\r\n  <div class='topbar clearfix'>\r\n    <!-- if repo and authenticated -->\r\n    <!-- #user/repo/new/branch/path -->\r\n    <div id='search' class='fl content-search round'></div>\r\n    <a href='#' class='fl button round new new-file' data-state='new'>\r\n      <%= t('navigation.newFile') %>\r\n    </a>\r\n  </div>\r\n\r\n  <div id='files'></div>\r\n</div>\r\n","search":"<span class='ico search'></span>\r\n<input type='text' id='filter' placeholder=\"<%= search.placeholder %>\" />\r\n","sidebar":{"branches":"<div class='inner'>\r\n  <h2 class='label'><%= t('sidebar.repo.branch') %></h2>\r\n  <select class='chzn-select'></select>\r\n</div>\r\n","drafts":"<a class='button round' href='#<%= link %>'><%= t('sidebar.repo.drafts') %></a>\r\n","label":"<div class='inner'>\r\n  <h2 class='label inner'><%= label %></h2>\r\n</div>\r\n","li":{"commit":"<a class='<%= data.status %>' href='#<%- [data.repo.owner.login, data.repo.name, data.mode, data.branch, data.path].join(\"/\") %>'>\r\n  <span class='ico small inline <%= data.status %>'></span>\r\n  <span class='message'><%- data.file.filename %></span>\r\n</a>\r\n"},"orgs":"<div class='inner'>\r\n  <h2 class='label'><%= t('sidebar.repos.groups') %></h2>\r\n</div>\r\n<ul class='listing'>\r\n  <li>\r\n    <a href='#<%= orgs.login.user %>' title='<%= orgs.login.user %>' data-id='<%= orgs.login.id %>'>\r\n      <%= orgs.login.user %>\r\n    </a>\r\n  </li>\r\n  <% orgs.orgs.each(function(org) {  %>\r\n  <li>\r\n    <a href='#<%= org.login %>' title='<%= org.login %>' data-id='<%= org.id %>'>\r\n      <%= org.login %>\r\n    </a>\r\n  </li>\r\n  <% });Â %>\r\n</ul>\r\n","save":"<div class='inner'>\r\n  <h2 class='label'><%= t('sidebar.save.label') %></h2>\r\n</div>\r\n<div class='inner authoring'>\r\n  <div class='commit'>\r\n    <textarea class='commit-message' placeholder></textarea>\r\n    <a class='ico small cancel round' title=\"<%= t('sidebar.save.cancel') %>\" href='#' data-action='cancel'>\r\n      <span class='popup round arrow-bottom'><%= t('sidebar.save.cancel') %></span>\r\n    </a>\r\n  </div>\r\n  <a class='confirm button round' href='#' data-action='confirm'><%= writable %></a>\r\n</div>\r\n","settings":"<div class='inner'>\r\n  <h2 class='label'><%= t('sidebar.settings.title') %></h2>\r\n</div>\r\n<div class='inner authoring'>\r\n  <% if (/^_posts/.test(settings.path)) { %>\r\n    <a class='draft button round' href='#' data-action='draft'><%= t('sidebar.settings.draft') %></a>\r\n  <% } %>\r\n  \r\n  <% if (settings.languages && settings.lang !== 'yaml') { %>\r\n    <% _.each(settings.languages, function(l) { %>\r\n      <% if (l.value && (settings.metadata && (settings.metadata.lang !== l.value))) { %>\r\n        <a class='translate round button' href='#<%= l.value %>' data-action='translate'><%= t('sidebar.settings.translate') + ' ' + l.name %></a>\r\n      <% } %>\r\n    <% }); %>\r\n  <% } %>\r\n\r\n  <!-- if !isNew() and is writable -->\r\n  <a class='delete button round' href='#' data-action='destroy'><%= t('sidebar.settings.delete') %></a>\r\n</div>\r\n\r\n<% if (settings.fileInput) { %>\r\n  <div class='inner'>\r\n    <h2 class='label'><%= t('sidebar.settings.fileInputLabel') %></h2>\r\n    <input type='text' class='filepath' placeholder='<%= settings.path %>' value='<%= settings.path %>'>\r\n  </div>\r\n<% } %>\r\n"},"start":"<div class='round splash'>\r\n  <h2 class='icon landing'>Prose</h2>\r\n  <div class='inner'>\r\n    <p><%= t('main.start.content') %></p>\r\n    <p><a href='#about'><%= t('main.start.learn') %></a></p>\r\n    <a class='round button' href='<%= auth.site %>/login/oauth/authorize?client_id=<%= auth.id %>&scope=<%- auth.scope %>'><%= t('login') %></a>\r\n    <div class=\"toggle-hide\">\r\n      <a href=\"#scopes\" class=\"deemphasize\">Set repository access</a>\r\n      <select>\r\n        <option value=\"repo\" <% if (auth.scope === 'repo') {%>selected<% } %>>Public and private repositories</option>\r\n        <option value=\"public_repo\" <% if (auth.scope === 'public_repo') {%>selected<% } %>>Only public repositories</option>\r\n      </select>\r\n    </div>\r\n  </div>\r\n</div>\r\n","toolbar":"<link href=\"https://fonts.googleapis.com/icon?family=Material+Icons\" rel=\"stylesheet\">\r\n\r\n<% if (toolbar.draft) { %>\r\n  <a href='#' class='draft-to-post round contain'>\r\n    <%= t('actions.draft.toPost') %><span class='ico small checkmark'></span>\r\n    <span class='popup round arrow-top'><%= t('actions.draft.toPostInfo') %></span>\r\n  </a>\r\n<% } else { %>\r\n  <% if (toolbar.metadata && toolbar.metadata.published) { %>\r\n    <a href='#' class='publish-flag published round contain' data-state='true'>\r\n      <%= t('actions.publishing.published') %><span class='ico small checkmark'></span>\r\n    </a>\r\n  <% } else if (toolbar.metadata && !toolbar.metadata.published) { %>\r\n    <a href='#' class='publish-flag round contain' data-state='false'>\r\n      <%= t('actions.publishing.unpublished') %><span class='ico small checkmark'></span>\r\n    </a>\r\n  <% } %>\r\n<% } %>\r\n\r\n<% if (toolbar.markdown) { %>\r\n<div class='options clearfix'>\r\n\r\n<!-- MATIN - New Buttons -->\r\n\r\n  <!-- Headers -->\r\n\r\n  <ul class='group round clearfix'>\r\n\t<li><a href='#' title=\"Main Heading\" data-key='mainheading' data-snippet='<% print(\"#\\n\\n\") %>'>h1</a></li>\r\n    <li><a href='#' title=\"<%= t('toolbar.heading') %>\" data-key='heading' data-snippet='<% print(\"##\\n\\n\") %>'>h2</a></li>\r\n    <li><a href='#' title=\"<%= t('toolbar.subHeading') %>\" data-key='sub-heading' data-snippet='<% print(\"###\\n\\n\") %>'>h3</a></li>\r\n\t<li><a href='#' title=\"Rule\" data-key='rule' data-snippet='<% print(\"------\\n\\n\") %>'><i class=\"material-icons\" style=\"font-size: 20px; vertical-align: middle;\">remove</i></a></li>\r\n  </ul>\r\n    \r\n  <!-- Emphasis -->\r\n  \r\n  <ul class='group round clearfix'>\r\n    <li><a href='#' title=\"<%= t('toolbar.bold') %>\" data-key='bold' data-snippet='****'>B</a></li>\r\n    <li>\r\n      <a data-key='italic' href='#' title=\"<%= t('toolbar.italic') %>\" data-snippet='__'>\r\n        <span class='ico small italic'></span>\r\n      </a>\r\n    </li>\r\n\t<li><a class='round' title=\"Underline\" href='#' data-key='underline' data-snippet='<% print(\"&lt;u&gt;&lt;/u&gt;\"); %>' data-dialog=true><i class=\"material-icons\" style=\"font-size: 16px; vertical-align: middle;\">format_underlined</i></a></li>\t\r\n  </ul>\r\n  \r\n  <!-- Alignment -->\r\n  \r\n  <ul class='group round clearfix'>\r\n    <li><a class='round' title=\"Left\" href='#' data-key='aleft' data-snippet='<% print(\"&lt;p align=&quot;left&quot;&gt;\\n\\n&lt;/p&gt;\"); %>'  data-dialog=true><i class=\"material-icons\" style=\"font-size: 20px; vertical-align: middle;\">format_align_left</i></a></li>\r\n\t<li><a class='round' title=\"Center\" href='#' data-key='acenter' data-snippet='<% print(\"&lt;p align=&quot;center&quot;&gt;\\n\\n&lt;/p&gt;\"); %>' data-dialog=true><i class=\"material-icons\" style=\"font-size: 20px; vertical-align: middle;\">format_align_center</i></a></li>\r\n\t<li><a class='round' title=\"Right\" href='#' data-key='aright' data-snippet='<% print(\"&lt;p align=&quot;right&quot;&gt;\\n\\n&lt;/p&gt;\"); %>' data-dialog=true><i class=\"material-icons\" style=\"font-size: 20px; vertical-align: middle;\">format_align_right</i></a></li>\r\n\t<li><a class='round' title=\"Justify\" href='#' data-key='ajustify' data-snippet='<% print(\"&lt;p align=&quot;justify&quot;&gt;\\n\\n&lt;/p&gt;\"); %>' data-dialog=true><i class=\"material-icons\" style=\"font-size: 20px; vertical-align: middle;\">format_align_justify</i></a></li>\r\n  </ul>\r\n  \r\n  <!-- Colors -->\r\n  \r\n  <ul class='group round clearfix'>\r\n    <li><a class='round' title=\"Red\" href='#' data-key='red' data-snippet='<% print(\"&lt;p style=&quot;color:red&quot;&gt;\\n\\n&lt;/p&gt;\"); %>'  data-dialog=true><i class=\"material-icons\" style=\"font-size: 16px; vertical-align: middle; color: rgba(255, 0, 0, 1);\">format_color_text</i></a></li>\r\n\t<li><a class='round' title=\"Green\" href='#' data-key='green' data-snippet='<% print(\"&lt;p style=&quot;color:green&quot;&gt;\\n\\n&lt;/p&gt;\"); %>'  data-dialog=true><i class=\"material-icons\" style=\"font-size: 16px; vertical-align: middle; color: rgba(0, 255, 0, 1);\">format_color_text</i></a></li>\r\n\t<li><a class='round' title=\"Blue\" href='#' data-key='blue' data-snippet='<% print(\"&lt;p style=&quot;color:blue&quot;&gt;\\n\\n&lt;/p&gt;\"); %>'  data-dialog=true><i class=\"material-icons\" style=\"font-size: 16px; vertical-align: middle; color: rgba(0, 0, 255, 1);\">format_color_text</i></a></li>\r\n  </ul>\r\n  \r\n  <!-- List -->\r\n  \r\n  <ul class='group round clearfix'>\r\n    <li>\r\n      <a title=\"<%= t('toolbar.blockquote') %>\"  href='#' data-key='quote' data-snippet='<% print(\"> We loved with a love that was more than love\\n\\n\"); %>'>\r\n        <span class='ico small quote'></span>\r\n      </a>\r\n    </li>\r\n    <li>\r\n      <a href='#' title=\"<%= t('toolbar.list') %>\" data-key='list' data-snippet='<% print(\"- item\\n- item\\n- item\\n\\n\"); %>'>\r\n        <span class='ico small list'></span>\r\n      </a>\r\n    </li>\r\n    <li>\r\n      <a href='#' title=\"<%= t('toolbar.numberedlist') %>\" data-key='numbered-list' data-snippet='<% print(\"1. item\\n2. item\\n3. item\\n\\n\"); %>'>\r\n        <span class='ico small numbered-list'></span>\r\n      </a>\r\n    </li>\r\n  </ul>\r\n  \r\n  <!-- Embed -->\r\n  \r\n  <ul class='group round clearfix'>\r\n    <li>\r\n      <a title=\"<%= t('toolbar.link') %>\" href='#' data-key='link' data-snippet=false data-dialog=true>\r\n        <span class='ico small link'></span>\r\n      </a>\r\n    </li>\r\n    <li>\r\n      <a title=\"<%= t('toolbar.image') %>\" href='#' data-key='media' data-snippet=false data-dialog=true>\r\n        <span class='ico small picture'></span>\r\n      </a>\r\n    </li>\r\n  </ul>   \r\n  \r\n  <!-- Code Block -->\r\n  \r\n  <ul class='group round clearfix'>\r\n    <li><a class='round' title=\"Code Block\" href='#' data-key='cblock' data-snippet='<% print(\"```\\n\\n```\\n\"); %>' data-dialog=true><i class=\"material-icons\" style=\"font-size: 20px; vertical-align: middle;\">code</i></a></li>\r\n\t<li><a class='round' title=\"Highlighted Code Block\" href='#' data-key='hcblock' data-snippet='<% print(\"{% highlight python %}\\n\\n{% endhighlight %}\\n\"); %>' data-dialog=true><i class=\"material-icons\" style=\"font-size: 14px; vertical-align: middle;\">polymer</i></a></li>\r\n  </ul>\r\n  \r\n  <!-- Slide Layout -->\r\n  \r\n  <ul class='group round clearfix'>\r\n    <li><a class='round' title=\"Horizontal Slide\" href='#' data-key='hslide' data-snippet='<% print(\"{{ page.horizontal }}\\n\\n\"); %>' data-dialog=true><i class=\"material-icons\" style=\"font-size: 20px; vertical-align: middle;\">panorama_horizontal</i></a></li>\r\n\t<li><a class='round' title=\"Vertical Slide\" href='#' data-key='vslide' data-snippet='<% print(\"{{ page.vertical }}\\n\\n\"); %>' data-dialog=true><i class=\"material-icons\" style=\"font-size: 20px; vertical-align: middle;\">panorama_vertical</i></a></li>\r\n  </ul>\r\n  \r\n  <!-- Help -->\r\n  \r\n  <ul class='group round clearfix'>\r\n    <li>\r\n    <a class='round' title=\"<%= t('toolbar.help') %>\" href='#' data-key='help' data-snippet=false data-dialog=true>\r\n        <span class='ico small question'></span>\r\n      </a>\r\n    </li>\r\n  </ul>\r\n  \r\n<!-- MATIN - End -->\r\n \r\n</div>\r\n<% } %>\r\n<div id='dialog'></div>\r\n"};